import { Box, Container, Stack } from "@mui/material";

//import { styled } from '@mui/system';
import useMediaQuery from "../hooks/useMediaQuery";
import { Images }from '../Constants/images'
//import { motion } from "framer-motion";

const Header = () => {
  const Media = useMediaQuery("(min-width:1070px)");
  return (
    <div style={{ width:"100%", height:`${Media? "100vh" : "100%"}` }}>
      <Box className="ml-[5%]" width={`${Media ? "90%" : "90%"}`}>
        <Container maxWidth={"lg"}>

        
        <div className="w-[100%] h-[100%] flex justify-center items-center">
            <Stack
              direction={`${Media ? "row" : "column"}`}
              spacing={4}
              width={`${Media ? "100%" : "100%"}`}
              height={`${Media ? "75%" : "80%"}`}
              display={"flex"}
              justifyContent={"space-between"}
              style={{
                //backgroundColor: "black",
                padding: `${Media ? "50px" : "20px"}`,
              }}
            >
              <Stack
                width={`${Media ? "600px" : "100%"}`}
                //style={{ backgroundColor: "blueviolet" }}
                className="rounded-2xl shadow-2xl  "
                height={`${Media ? "100%" : "70% "}`}
                maxHeight={`${Media ? "100%":"600px"}`}
              >
                <div className="w-[100%] m-[30px]">
                  <h1 className="text-black text-5xl"> <span className="font-google text-primarycolor">Flash</span> Rooms</h1>
                </div>
                <div>
                  <Stack>
                    {/* <img src={Images.Quots}/> */}
                    <div>

                    </div>
                    <div>
                      
                    </div>
                  </Stack>
                </div>
              </Stack>
              <Stack
                width={`${Media ? "900px" : "100%"}`}
                style={{ backgroundColor: "blueviolet" }}
                className="p-[10px]"
                height={`${Media ? "100% " : "80% "}`}
              >
                <h1 className="text-white">hello</h1>
                <Stack direction={"column"} width={""}>
                    
                </Stack>
                <div>
                  <h1 className="text-3xl as">Test</h1>
                  <img src={Images.House} alt="Houes"/>
                </div>
              </Stack>
            </Stack>
        </div>
        </Container>
        </Box>
      </div>
  );
};

export default Header;
